						"<select id=\"gensrcCmmUse.gensrcCmmUse.page.list\" resultType=\"hashmap\" >",
						"\n\tSelect \n\t\t\t*\t\t\n\t\tFrom \n\t\t(\n\t\t\tselect\n\t\t\t\tA.*, ROWNUM AS ROW_NUM\n\t\t\tfrom \n\t\t\t(\n\n",
						"\tselect ",
						"\t\tTABLE_NAME,COLUMN_NAME,CODE_CATEGORY",
						"\tfrom GENSRC_CMM_USE a ",
						"\twhere 1=1",
						"\t<if test=\"search_tableName != null and search_tableName !='' \">",
						"\t\tand table_name = #{search_tableName}",
						"\t</if>",
						"\t<if test=\"search_columnName != null and search_columnName !='' \">",
						"\t\tand column_name = #{search_columnName}",
						"\t</if>",
						"\t<if test=\"search_codeCategory != null and search_codeCategory !='' \">",
						"\t\tand code_category = #{search_codeCategory}",
						"\t</if>",
						"\t<if test=\"gensrcCmmCdCodeCategorySearchMultiComboArr != null and gensrcCmmCdCodeCategorySearchMultiComboArr !='' \">",
						"\t\tand code_category in ",
						"\t\t\t<foreach collection=\"gensrcCmmCdCodeCategorySearchMultiComboArr\" item=\"item\" index=\"index\" open=\"(\" separator=\",\" close=\")\" >",
						"\t\t\t#{item}",
						"\t\t\t</foreach>",
						"\t</if>",
